      SELECT DISTINCT - COUNT ( * ) col2 FROM tab1 AS cor0 WHERE NOT col0 BETWEEN - col0 * - col0 * - + col0 * ( col1 ) - - col0 AND CAST ( col1 AS INTEGER );
  - name: tab1

outputs:
